import React from "react";

const [currenTask, setCurrentTask] = useState()


const Task = (props) =>{
    return(
        <>
            <div className='Taskcard' onClick={()=>{
                setCurrentTask(props.title)
            }}>
                <div className='Task-Size-Overlay'>
                    <span className='Task-Size'>2</span>
                </div>
                <div className='Task-Content'>
                    <span className='Task-Tag'>#Study</span>
                    <span className='Task-Title is-size-5'>{props.title}</span>
                </div>
            </div>
        </>
    )
}

export default Task;
